// src/components/Navbar.js
import React from 'react';
import { useNavigate, Link } from 'react-router-dom';
import { useKeycloak } from '@react-keycloak/web';
import { 
  Drawer, 
  List, 
  ListItem, 
  ListItemButton, 
  ListItemIcon, 
  ListItemText, 
  Box, 
  Divider, 
  Typography 
} from '@mui/material';
import {
  Dashboard as DashboardIcon,
  Chat as ChatIcon,
  Description as FichaIcon,
  Logout as LogoutIcon
} from '@mui/icons-material';

const drawerWidth = 240;

const Navbar = () => {
  const navigate = useNavigate();
  const { keycloak } = useKeycloak();

  const menuItems = [
    { text: 'Dashboard', icon: <DashboardIcon />, path: '/dashboard' },
    { text: 'Chat Integrado', icon: <ChatIcon />, path: '/chat' },
    { text: 'Ficha do Paciente', icon: <FichaIcon />, path: '/ficha-paciente' }
  ];

  const handleLogout = () => {
    keycloak.logout({ redirectUri: 'http://localhost:3002/' });
  };

  return (
    <Drawer
      variant="permanent"
      sx={{
        width: drawerWidth,
        flexShrink: 0,
        [`& .MuiDrawer-paper`]: { width: drawerWidth, boxSizing: 'border-box' },
        backgroundColor: "#f5f5f5"
      }}
    >
      <Box sx={{ overflow: 'auto' }}>
        <List>
          <Typography variant="h6" sx={{ textAlign: 'center', mt: 2, mb: 2 }}>
            AdamChat
          </Typography>
          <Divider />

          {menuItems.map((item, index) => (
            <ListItem key={index} disablePadding>
              <ListItemButton 
                component={Link} 
                to={item.path}
                sx={{ 
                  '&.Mui-selected': { backgroundColor: '#e0e0e0' }
                }}
              >
                <ListItemIcon>{item.icon}</ListItemIcon>
                <ListItemText primary={item.text} />
              </ListItemButton>
            </ListItem>
          ))}
        </List>
        <Divider />
        <Box sx={{ mt: 'auto', p: 2 }}>
          {keycloak.authenticated && keycloak.tokenParsed && (
            <>
              <Typography variant="body2" align="center">
                {keycloak.tokenParsed.name || keycloak.tokenParsed.preferred_username}
              </Typography>
              <ListItemButton onClick={handleLogout}>
                <ListItemIcon><LogoutIcon /></ListItemIcon>
                <ListItemText primary="Deslogar" />
              </ListItemButton>
            </>
          )}
        </Box>
      </Box>
    </Drawer>
  );
};

export default Navbar;
